--init
    --Vec3
    Vec3 = {}
    function Vec3:new(_x,_y,_z)
        return setmetatable({
            x = _x or 0,y = _y or 0,z = _z or 0
        },{
            __add = function(_v1,_v2)
                return Vec3:new(_v1.x+_v2.x,_v1.y+_v2.y,_v1.z+_v2.z)
            end,
            __sub = function(_v1,_v2)
                return Vec3:new(_v1.x-_v2.x,_v1.y-_v2.y,_v1.z-_v2.z)
            end,
            __mul = function(_v1,_v2)
                return Vec3:new(_v1.x*_v2.x,_v1.y*_v2.y,_v1.z*_v2.z)
            end
        })
    end

    function Vec3:dot(_v1,_v2)
        return (_v1.x*_v2.x)+(_v1.y*_v2.y)+(_v1.z*_v2.z)
    end

    function Vec3:cross(_v1,_v2)
        return Vec3:new(_v1.y * _v2.z - _v1.z * _v2.y, _v1.z * _v2.x - _v1.x * _v2.z, _v1.x * _v2.y - _v1.y * _v2.x)
    end

    function Vec3:unitV(_v)
        if _v.x==0 and _v.y==0 and _v.z==0 then
            return _v
        end
        local d = 1/(_v.x^2+_v.y^2+_v.z^2)^0.5
        return Vec3:new(_v.x*d,_v.y*d,_v.z*d)
    end

    function Vec3:norm(_v)
        return (_v.x^2+_v.y^2+_v.z^2)^0.5
    end

    function Vec3:mul(_t,_v)
        return Vec3:new(_t*_v.x,_t*_v.y,_t*_v.z)
    end

    --Ray
    Ray = {}
    function Ray:new(_v1,_v2)
        return {
        origin = Vec3:new(_v1.x or 0,_v1.y or 0,_v1.z or 0),
        dir = Vec3:unitV(Vec3:new(_v2.x or 0,_v2.y or 0,_v2.z or 0))
    }
    end

    function Ray:at(_r,_t)
        return Vec3:new(_r.origin.x + _r.dir.x * _t,_r.origin.y + _r.dir.y * _t,_r.origin.z + _r.dir.z * _t)
    end

    --Color
    Color = {}
    function Color:new(_r,_g,_b)
        return setmetatable({
            r=_r,
            g=_g,
            b=_b,
        },{
            __mul = function (_c1,_c2)
                return Color:new(_c1.r/255*_c2.r,_c1.g/255*_c2.g,_c1.b/255*_c2.b)
            end,
            __add = function (_c1,_c2)
                return Color:new(math.min(255,_c1.r+_c2.r),math.min(255,_c1.g+_c2.g),math.min(255,_c1.b+_c2.b))
            end
        })
    end
    function Color:mul(_t,_c)
        return Color:new(_t*_c.r,_t*_c.g,_t*_c.b)
    end

    --intersect
    function Intersect(_r)
        local rtn = {}
        rtn[1] = Light:Check(_r)
        rtn[2] = Mball:Check(_r)
        rtn[3] = Ceil:Check(_r)
        rtn[4] = Floor:Check(_r)
        rtn[5] = Lwall:Check(_r)
        rtn[6] = Rwall:Check(_r)
        rtn[7] = Fwall:Check(_r)
        return rtn
    end

    --points
    Camera = Vec3:new(0,0,-220)

    --objects
        --box
            Ceil = {ux = -160.0,uz = 0.0,vx = 160.0,vz = 240.0,y = 120.0,tex = Color:new(21,88,129)}
            function Ceil:Check(_r)
                --print("now checking for ceil")
                if _r.dir.y > 0 then
                    local p = Ray:at(_r,(Ceil.y-_r.origin.y)/_r.dir.y)
                    if Ceil.ux <= p.x and p.x <= Ceil.vx and Ceil.uz <= p.z and p.z <= Ceil.vz then
                        --print("ceil hit! location:",p.x,p.y,p.z)
                        return {normline = Ray:new(p,Vec3:new(0,-1,0)),surf = 1,dist = Vec3:norm(_r.origin-p),tex = Ceil.tex}
                    end
                    --print("too far to reach the ceil! location:",p.x,p.y,p.z)
                end
                --print("ceil miss")
                return nil
            end

            Floor = {ux = -160.0,uz = 0.0,vx = 160.0,vz = 240.0,y = -120.0,tex = Color:new(142,112,8)}
            function Floor:Check(_r)
                --print("now checking for floor")
                if _r.dir.y < 0 then
                    local p = Ray:at(_r,(Floor.y-_r.origin.y)/_r.dir.y)
                    if Floor.ux <= p.x and p.x <= Floor.vx and Floor.uz <= p.z and p.z <= Floor.vz then
                        --print("floor hit! location:",p.x,p.y,p.z)
                        return {normline = Ray:new(p,Vec3:new(0,1,0)),surf = 1,dist = Vec3:norm(_r.origin-p),tex = Floor.tex}
                    end
                    --print("too far to reach the floor! location:",p.x,p.y,p.z)
                end
                --print("floor miss")
                return nil
            end

            Lwall = {uy = -120.0,uz = 0.0,vy = 120.0,vz = 240.0,x = -160.0,tex = Color:new(136,66,72)}
            function Lwall:Check(_r)
                --print("now checking for leftwall")
                if _r.dir.x < 0 then
                    local p = Ray:at(_r,(Lwall.x-_r.origin.x)/_r.dir.x)
                    if Lwall.uy <= p.y and p.y <= Lwall.vy and Lwall.uz <= p.z and p.z <= Lwall.vz then
                        --print("leftwall hit! location:",p.x,p.y,p.z)
                        return {normline = Ray:new(p,Vec3:new(1,0,0)),surf = 1,dist = Vec3:norm(_r.origin-p),tex = Lwall.tex}
                    end
                    --print("too far to reach the leftwall! location:",p.x,p.y,p.z)
                end
                --print("leftwall miss")
                return nil
            end

            Rwall = {uy = -120.0,uz = 0.0,vy = 120.0,vz = 240.0,x = 160.0,tex = Color:new(57,142,42)}
            function Rwall:Check(_r)
                --print("now checking for rightwall")
                if _r.dir.x > 0 then
                    local p = Ray:at(_r,(Rwall.x-_r.origin.x)/_r.dir.x)
                    if Rwall.uy <= p.y and p.y <= Rwall.vy and Rwall.uz <= p.z and p.z <= Rwall.vz then
                        --print("rightwall hit! location:",p.x,p.y,p.z)
                        return {normline = Ray:new(p,Vec3:new(-1,0,0)),surf = 1,dist = Vec3:norm(_r.origin-p),tex = Rwall.tex}
                    end
                    --print("too far to reach the rightwall! location:",p.x,p.y,p.z)
                end
                --print("rightwall miss")
                return nil
            end

            Fwall = {ux = -160.0,uy = -120.0,vx = 160.0,vy = 120.0,z = 240.0,tex = Color:new(142,62,7)}
            function Fwall:Check(_r)
                --print("now checking for frontwall")
                if _r.dir.z > 0 then
                    local p = Ray:at(_r,(Fwall.z-_r.origin.z)/_r.dir.z)
                    if Fwall.ux <= p.x and p.x <= Fwall.vx and Fwall.uy <= p.y and p.y <= Fwall.vy then
                        --print("frontwall hit! location:",p.x,p.y,p.z)
                        return {normline = Ray:new(p,Vec3:new(0,0,-1)),surf = 1,dist = Vec3:norm(_r.origin-p),tex = Fwall.tex}
                    end
                    --print("too far to reach the frontwall! location:",p.x,p.y,p.z)
                end
                --print("frontwall miss")
                return nil
            end

        --light
            Light = {origin = Vec3:new(-100,-90,70),radius = 10,tex = Color:new(255,255,255)}
            function Light:Check(_r)
                --print("now checking for light")
                local l = Light.origin - _r.origin
                local s = Vec3:dot(l,_r.dir)
                local l2 = Vec3:dot(l,l)
                if s < 0 and l2 > Light.radius^2 then
                    --print("light miss")
                    return nil
                end
                local m2 = l2 - s^2
                if m2 > Light.radius^2 then
                    --print("light miss")
                    return nil
                end
                local q = (Light.radius^2-m2)^0.5
                local t
                if l2 > Light.radius^2 then
                    t = s - q
                else
                    t = s + q
                end
                local p = Ray:at(_r,t)
                --print("light hit! location:",p.x,p.y,p.z)
                return {normline = Ray:new(p,p - Light.origin),surf = 0,dist = Vec3:norm(_r.origin-p),tex = Light.tex}
            end
        --mirrorball
        Mball = {origin = Vec3:new(35,-45,150),radius = 50,tex = Color:new(250,250,250)}
        function Mball:Check(_r)
            --print("now checking for mirrorball")
            local l = Mball.origin - _r.origin
                local s = Vec3:dot(l,_r.dir)
                local l2 = Vec3:dot(l,l)
                if s < 0 and l2 > Mball.radius^2 then
                    --print("ball miss")
                    return nil
                end
                local m2 = l2 - s^2
                if m2 > Mball.radius^2 then
                    --print("ball miss")
                    return nil
                end
                local q = (Mball.radius^2-m2)^0.5
                local t
                if l2 > Mball.radius^2 then
                    t = s - q
                else
                    t = s + q
                end
                local p = Ray:at(_r,t)
                --print("ball hit! location:",p.x,p.y,p.z)
                return {normline = Ray:new(p,p - Mball.origin),surf = 2,dist = Vec3:norm(_r.origin-p),tex = Mball.tex}
        end

--draw
    function Raytrack(_r,_depth)
        --print("now dealing Ray is:origin=("..tostring(_r.origin.x)..","..tostring(_r.origin.y)..","..tostring(_r.origin.z)..");dir=("..tostring(_r.dir.x)..","..tostring(_r.dir.y)..","..tostring(_r.dir.z)..")")
        if _depth > 9 then
            --print("out of depth,giveup")
            return Color:new(0,0,0)
        end
        --print("depth:",_depth)
        local intlist = Intersect(_r)
        local min = {n=32767,i=0}
        --print("now check objects one by one")
        for i=1,7 do
            --print("object",i,"dist",intlist[i] == nil or intlist[i].dist )
            if intlist[i] ~= nil and intlist[i].dist < min.n then
                min.n = intlist[i].dist
                min.i = i
                --print("set min object",i)
            end
        end
        --print("done")
        if min.n == 32767 then
            --print("miss everything! giveup")
            return Color:new(0,0,0)
        end
        --print("the nearest object matches number",min.i)
        min.t = intlist[min.i]
        local light1
        local depth = _depth
        if min.t.surf == 0 then
            --print("hit light! returning successfully")
            return Light.tex
        elseif min.t.surf == 1 then
            --print("hit no-mirror object. calculating whether it can be lightted")
            local ptolight = Light.origin - min.t.normline.origin
            local checkdist = Mball:Check(Ray:new(min.t.normline.origin,ptolight))
            if checkdist == nil or checkdist.dist > Vec3:norm(ptolight) then
                --print("Yes it can!")
                light1 = Color:mul(Vec3:dot(min.t.normline.dir,Vec3:unitV(ptolight)),min.t.tex*Light.tex)
            else
                --print("it was shadowed!")
                light1 = Color:new(0,0,0)
            end
            --[[
            if  depth < 10 then
                depth = 10
            end
            --]]
        else
            light1 = Color:new(0,0,0)
        end
        --print("get colour light1:",ToTiRGB(light1))
        --print("now rasing a new track for light 2")
        local newray = Ray:new(min.t.normline.origin,_r.dir-Vec3:mul(2*Vec3:dot(_r.dir,min.t.normline.dir),min.t.normline.dir))
        local light2 = Color:mul(0.5*min.t.surf,Raytrack(Ray:new(Ray:at(newray,0.1),newray.dir),depth+1)*min.t.tex)
        --print("get colour light2:",ToTiRGB(light2))
        --print("mix light1 and light2 then return:",ToTiRGB(light1+light2))
        return light1+light2
    end

    function ToTiRGB(_c)
        return math.floor(_c.r),math.floor(_c.g),math.floor(_c.b)
    end

